// Input: items[0].json.output contains the raw text from the Carousel Prompt Generator
// Output: [{json: { index, prompt }}] for each slide

const raw = $input.first().json.output || '';
if (!raw) return [];

const parts = raw.split(/===\s*SLIDE\s*\d+\s*PROMPT\s*===/i).map(p => p.trim()).filter(Boolean);

const out = parts.map((p, i) => {
  return {
    json: {
      index: i + 1,
      prompt: p
    }
  };
});

return out;

