// Input: One item with text containing Google Drive links
// Goal: Extract only image links (skipping PDFs) and build Airtable-ready output

// 1. Retrieve the input text from the previous node.
// NOTE: Ensure 'Search records1' and 'Media Link' match your actual node/field names.
const originalInputText = $('Search records1').first().json["Media Link"] || '';

const downloadLinks = [];
const images = {};
let counter = 1;
const foundDriveIds = new Set(); // Used to prevent processing duplicate link IDs

// --- Step 1: Identify and Exclude the PDF Link ---
let pdfIdToExclude = null;

// Regex to find a link that is immediately preceded by the 'Pdf:' label and capture its ID.
const pdfMatch = originalInputText.match(/Pdf:.*\/file\/d\/([a-zA-Z0-9_-]+)\/view/);

if (pdfMatch) {
    // If found, store the ID of the link associated with 'Pdf:' for exclusion.
    pdfIdToExclude = pdfMatch[1];
}


// --- Step 2: Extract ALL Drive IDs from the entire input string ---

// Robust Regex to find the Google Drive file ID (the long string after /d/)
// This pattern works regardless of whether the link is wrapped in <>, [], or has query params.
const driveIdRegex = /\/file\/d\/([a-zA-Z0-9_-]+)\/view/g; 

const matches = originalInputText.matchAll(driveIdRegex);


// --- Step 3: Process the extracted IDs (excluding the PDF) ---

for (const match of matches) {
    const driveId = match[1];

    // Check if the extracted ID is the one we marked for exclusion (the PDF ID)
    if (pdfIdToExclude && driveId === pdfIdToExclude) {
        continue;
    }

    // Skip if we've already processed this ID (in case of duplicate links in the text)
    if (foundDriveIds.has(driveId)) {
        continue;
    }
    foundDriveIds.add(driveId);

    // Construct the necessary URLs
    const webViewLink = `https://drive.google.com/file/d/${driveId}/view`;
    const downloadUrl = `https://drive.google.com/uc?export=download&id=${driveId}`;

    // Add to download link list
    downloadLinks.push({ url: downloadUrl });

    // Add to Airtable-ready object format (image field expects array of objects)
    const imageKey = `image${counter}`;
    images[imageKey] = [{ url: webViewLink }]; 

    counter++;
}

// Return the final data structure
return [
    {
        json: {
            downloadLinks, // A list of direct download links (useful for a separate HTTP request)
            images         // Object mapping image1, image2, etc. to attachment objects (Airtable-ready)
        }
    }
];

