// n8n Function Node: Split carousel prompts into separate items and extract Drive file IDs
// Input: items[0].json.output contains the raw text from the Carousel Prompt Generator
// Output: [{json: { index, prompt, file_id }}] for each slide

const raw = $input.first().json.output || '';
if (!raw) return [];

const parts = raw
  .split(/===\s*SLIDE\s*\d+\s*PROMPT\s*===/i)
  .map(p => p.trim())
  .filter(Boolean);

const driveRegex = /https:\/\/drive\.google\.com\/file\/d\/([a-zA-Z0-9_-]+)\//;

const out = parts.map((p, i) => {
  const match = p.match(driveRegex);
  const fileId = match ? match[1] : null;

  return {
    json: {
      index: i + 1,
      prompt: p,
      file_id: fileId
    }
  };
});

return out;
